func increasingTriplet(nums []int) bool {
	count := 0
	size := len(nums)
	if size >= 3 {
		for minIndex := findMinIndex(&nums, 0, size-1, -1<<32); minIndex >= 0; minIndex = findMinIndex(&nums, minIndex+1, size-1, nums[minIndex]) {
			count++
			if count >= 3 {
				return true
			}
		}
	}

	return false
}

func findMinIndex(nums *[]int, low int, high int, last int) int {
	ret := -1
	if low <= len(*nums)-1 && high > 0 {
		min := 1 << 32
		for i := low; i <= high; i++ {
			if min > (*nums)[i] && last < (*nums)[i] {
				min = (*nums)[i]
				ret = i
			}
		}
	}

	return ret
}

